import React from 'react';
import { Col, Container, Row } from 'reactstrap';
import "../styles/home.css"

const Home = () => {
  return (
    <>
      {/* ============ hero section start =========== */}
      <section className='hero-section'>
        <Container>
          <Row>
            <Col lg='12'>
            <div style={{ height: '80px', backgroundColor: '#FF9900', width: '100%' }}></div>

            </Col>
          </Row>
        </Container>
      </section>
      {/* ============ hero section end =========== */}

    </>
  );
};


export default Home;
